import React from 'react';

// implement some more features

function searchBar  (city, setCity){
  return(

   <form onSubmit ={(e) => {setCity(e); }}>
   <input
    type="text"
    placeholder="Enter a city..."
    autoComplete="off"
    value={city}
    onChange={(e) => (e.target.value)}
    />
  </form>
  );
}
export default searchBar
